'yes'),(2936,'wcj_invoicing_custom_doc_file_name','[wcj_custom_doc_number doc_nr=\"1\"]','yes'),(2937,'wcj_invoicing_custom_doc_roles','a:2:{i:0;s:13:\"administrator\";i:1;s:12:\"shop_manager\";}','yes'),(3034,'mobiconnector_settings-error-create-htaccess','0','yes'),(3037,'mobiconnector_settings-error-create-file','0','yes'),(3038,'mobiconnector_settings-error-copy-file','0','yes'),(3039,'mobiconnector_settings-session-expiry','86400','yes'),(3040,'mobiconnector_settings-use-cache-mobile','1','yes'),(3041,'mobiconnector_settings-text-core','s:9862:\"a:6:{s:30:\"mobiconnector_privacy_about_us\";s:8:\"About Us\";s:34:\"mobiconnector_description_about_us\";s:2604:\"<p>We would like to tell you a little bit about what makes our store special and why you should shop with us. For starters, we have a <strong>20,000 square foot store</strong> that stocks over 20,000 dresses. That’s right, you will not find anyone else out there that carries that much stock, especially an online retailer. We register all the dresses sold at our store and maintain our motto of not selling the same dress in the same color to the same event.</p>\n<p>We have nearly every prom dress in every size and color from every prominent dress designer. This is extremely important in the prom industry because it has such a short selling season. If you are in a pinch in March or April looking for the hottest selling style, We will have that gown for you because we order a huge quantity to begin with. No one wants to take a chance on ordering a dress and waiting 10 weeks to receive it! Most girls want to try their dress on and be able to take it home that same day to show off to their family and friends. At our store, that is exactly what you can do!</p>\n<p>We is unique in that we dedicate 90% of our floor space to prom dresses. Many online stores only stock one size samples and do not even have a brick and mortar, not us. We like to think of ourselves as a tremendous retail store that warehouses all styles, sizes, and colors. Whatever your event may be: Quinceneara, Sweet Sixteen, Pageant, Prom, Homecoming, Engagement, Wedding, and any other event, We will have the dress of your dreams!</p>\n<p>While shopping for your perfect dress, our store’s staff is fully trained to provide the best customer service imaginable. Our staff is fluent in Polish and Spanish and they will pamper you like a princess and make you look perfect from head to toe. At our store, the staff understands what styles are the most figure flattering for your body. We carry gorgeous gowns in every size imaginable, from sizes 0-30 IN STOCK! Whether you are searching for a curve hugging mermaid dress, an elegant A-line style, or a Cinderella style ball gown, we’ll find the perfect dress for you! We carry stunning shoes and every accessory imaginable (earrings, necklace set’s, bracelets, tiaras, headbands, and much more!).</p>\n<p>We also provide on site alterations. The same day you purchase your dress, you can get pinned for alterations and not have to worry about finding a seamstress that you do not know and trust.</p>\n<p>We knows how important prom night is for you and that is why we strive to maintain our motto of never selling the same dress in the same color to the same event.</p>\n\";s:32:\"mobiconnector_terms_ofuser_title\";s:27:\"Terms and Conditions of Use\";s:36:\"mobiconnector_description_term_ofuse\";s:3882:\"<h2>1. Terms</h2>\n<p>By accessing this web site, you are agreeing to be bound by these web site Terms and Conditions of Use, all applicable laws and regulations, and agree that you are responsible for compliance with any applicable local laws. If you do not agree with any of these terms, you are prohibited from using or accessing this site. The materials contained in this web site are protected by applicable copyright and trade mark law.</p>\n<h2>2. Use License</h2>\n<p>Permission is granted to temporarily download one copy of the materials (information or software) on our web site 